u=zeros(sizeP,1);
for i=1:(sizeP-1)
    dt=t(i+1)-t(i);
    a1=1/(beta*dt^2)*m+gama/(beta*dt)*c;
    km=k+a1;
    a2=m/(beta*dt)+(gama/beta-1)*c;
    a3=(1/(2*beta)-1)*m+dt*(gama/(2*beta)-1)*c;
    pm(i+1)=P(i+1)+a1*u(i)+a2*v(i)+a3*a(i);
    u(i+1)=pm(i+1)/km;
    v(i+1)=gama/(beta*dt)*(u(i+1)-u(i))+(1-gama/beta)*v(i)+dt*(1-gama/(2*beta))*a(i);
    a(i+1)=1/(beta*dt^2)*(u(i+1)-u(i))-1/(beta*dt)*v(i)-(1/(2*beta)-1)*a(i);

end

plot(t,u)
